import React, { useState, useEffect } from 'react';
import '../styles/Dashboard.css';
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer, LineChart, Line } from 'recharts';

function Dashboard() {
  const [stats, setStats] = useState({
    bookings: 0,
    restaurants: 0,
    revenue: 0,
    customers: 0
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const token = localStorage.getItem('admin_token');
        const res = await fetch((process.env.REACT_APP_API_URL || process.env.REACT_APP_API_BASE || 'http://localhost:5000') + '/api/admin/analytics/stats', {
          headers: { Authorization: `Bearer ${token}` }
        });

        if (res.ok) {
          const data = await res.json();
          setStats(data);
        }
      } catch (error) {
        console.error('Error fetching stats:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchStats();
  }, []);

  const chartData = [
    { name: 'Jan', bookings: 120, revenue: 6000 },
    { name: 'Feb', bookings: 150, revenue: 7500 },
    { name: 'Mar', bookings: 180, revenue: 9000 },
    { name: 'Apr', bookings: 210, revenue: 10500 },
    { name: 'May', bookings: 170, revenue: 8500 },
    { name: 'Jun', bookings: 220, revenue: 11000 }
  ];

  if (loading) {
    return <div className="loading-container"><div className="loading-spinner"></div></div>;
  }

  return (
    <div className="dashboard-page">
      <div className="page-header">
        <h1 className="page-title">Dashboard Overview</h1>
        <p className="page-subtitle">Monitor your restaurant platform performance</p>
      </div>

      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-info">
            <span className="stat-label">Total Bookings</span>
            <span className="stat-value">{stats.bookings || 1240}</span>
            <span className="stat-trend trend-up">‚Üë 12% vs last month</span>
          </div>
          <div className="stat-icon icon-blue">üìÖ</div>
        </div>

        <div className="stat-card">
          <div className="stat-info">
            <span className="stat-label">Active Restaurants</span>
            <span className="stat-value">{stats.restaurants || 32}</span>
            <span className="stat-trend trend-up">‚Üë 3 new this week</span>
          </div>
          <div className="stat-icon icon-green">üè™</div>
        </div>

        <div className="stat-card">
          <div className="stat-info">
            <span className="stat-label">Total Revenue</span>
            <span className="stat-value">${stats.revenue || '18,400'}</span>
            <span className="stat-trend trend-up">‚Üë 8% vs last month</span>
          </div>
          <div className="stat-icon icon-purple">üí∞</div>
        </div>

        <div className="stat-card">
          <div className="stat-info">
            <span className="stat-label">Total Customers</span>
            <span className="stat-value">{stats.customers || 540}</span>
            <span className="stat-trend">Active users</span>
          </div>
          <div className="stat-icon icon-orange">üë•</div>
        </div>
      </div>

      <div className="charts-grid">
        <div className="chart-card">
          <h3 className="chart-title">Bookings Trend</h3>
          <ResponsiveContainer width="100%" height={280}>
            <BarChart data={chartData}>
              <XAxis dataKey="name" stroke="var(--text-secondary)" />
              <YAxis stroke="var(--text-secondary)" />
              <Tooltip
                contentStyle={{
                  background: 'white',
                  border: '1px solid var(--border-color)',
                  borderRadius: '0.5rem',
                  boxShadow: 'var(--shadow-md)'
                }}
              />
              <Bar dataKey="bookings" fill="url(#colorGradient)" radius={[8, 8, 0, 0]} />
              <defs>
                <linearGradient id="colorGradient" x1="0" y1="0" x2="0" y2="1">
                  <stop offset="0%" stopColor="#6366f1" />
                  <stop offset="100%" stopColor="#8b5cf6" />
                </linearGradient>
              </defs>
            </BarChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-card">
          <h3 className="chart-title">Revenue Growth</h3>
          <ResponsiveContainer width="100%" height={280}>
            <LineChart data={chartData}>
              <XAxis dataKey="name" stroke="var(--text-secondary)" />
              <YAxis stroke="var(--text-secondary)" />
              <Tooltip
                contentStyle={{
                  background: 'white',
                  border: '1px solid var(--border-color)',
                  borderRadius: '0.5rem',
                  boxShadow: 'var(--shadow-md)'
                }}
              />
              <Line
                type="monotone"
                dataKey="revenue"
                stroke="#ec4899"
                strokeWidth={3}
                dot={{ fill: '#ec4899', r: 5 }}
              />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
